import React from 'react';
import styled from 'styled-components';
import {TodoItems} from './todo.model'


interface TodoProps {
    todo: TodoItems;
  }

const Todo: React.FC<TodoProps> = ({todo}) => {
    return (
        <div>
    <h3>{todo.title}</h3>
      <span>{todo.completed ? 'Completed' : 'Not completed'}</span>
      <button>Edit</button>
      <button>Delete</button>
        </div>
    );
};

export default Todo;
